import axios from "axios"
import React from "react";

const api = axios.create({
baseURL: `https://gauss.com.br/produtos/wp-json/wp/v2/gauss_products/`

})


React.useEffect(() => {
    axios.get(baseURL).then((response) => {
      setPost(response.data);
    });
  }, []);




export default api;
